//# sourceMappingURL=jquery.min.map
function load_notifications(url, user_id)
{
		$('.navbar-notification .niceScroll').scroll(function(e)
		{
			var scrollbarheight = $(this)[0].scrollHeight;
			var topheight = $(this).scrollTop();
			var outerheight = $(this).outerHeight();
			
			if(scrollbarheight - topheight === outerheight)
			{
				var counter = $('.navbar-notification .niceScroll').attr('counter');
				$.ajax({
					type: 'POST',
					url: url,
					data:
					{
						user_id: user_id,
						count: counter,
						type: 'load'
					},
					datatype: 'json',
					success: function (data)
					{
						if(data.success)
						{
							//console.log('take: ' + data.take);
							//console.log('skip: ' + data.skip);
							//console.log('count: ' + data.count);
							
							//var count = $("#notifications_count").text();
							//$("#notifications_count").text(parseInt(count)+data.count);
							
							$("#notifications").append(data.html);
							$('.navbar-notification .niceScroll').attr('counter', parseInt(counter) + data.take);
						}
					}
				});
			}
		});
}

function realtime_notifications(url, user_id)
{
	var counter = $('.navbar-notification .niceScroll').attr('counter');
	$.ajax({
		type: 'POST',
		url: url,
		data:
		{
			user_id: user_id,
			count: counter,
			type: 'new',
		},
		datatype: 'json',
		success: function (data)
		{
			if(data.success)
			{
				if(!$("#notifications_count").length)
				{
					$('.dropdown.navbar-notification .dropdown-toggle').append('<span id="notifications_count" class="count label label-danger rounded">');
				}
				
				$("#notifications_count").text(data.count);
				$("#notifications").html(data.html);
				$('.navbar-notification .niceScroll').attr('counter', data.count);
			}
			
			
		}
	});
}
$(function() 
{
	var user_id = $("meta[name='user_id']").attr("content");
	var user_url = $("meta[name='user_url']").attr("content");
	var socket = io.connect('https://sourcemod.devsapps.com:10001');

	if(user_id > 0)
	{
		socket.emit('user_info', 
		{
			id: user_id,
			location: user_url,
		});

		socket.on('user_' + user_id, function(sdata) 
		{
			realtime_notifications('/ajax/notifications/list', user_id);
		});

		load_notifications('/ajax/notifications/list', user_id);
	}

	socket.on('users', function(sdata) 
	{
		var sum = 0;
		$.each(sdata, function(index, value)
		{
			if(value != null)
			{
				if(value.online)
				{
					$('.page-users-list #' + value.id).removeClass('bg-danger').addClass('bg-success');
					$('.page-scripts #' + value.id).removeClass('img-bordered-danger').addClass('img-bordered-success');
					$('.page-users #' + value.id).removeClass('img-bordered-danger').addClass('img-bordered-success');
					$('.page-community-replies #' + value.id).removeClass('img-bordered-danger').addClass('img-bordered-success');
					sum++;
				}
				else
				{
					$('.page-users-list #' + value.id).removeClass('bg-success').addClass('bg-danger');
					$('.page-scripts #' + value.id).removeClass('img-bordered-success').addClass('img-bordered-danger');
					$('.page-users #' + value.id).removeClass('img-bordered-success').addClass('img-bordered-danger');
					$('.page-community-replies #' + value.id).removeClass('img-bordered-success').addClass('img-bordered-danger');
				}
			}
		});
		
		$('#counter_online').html(sum);
	});
});
	
